pragma solidity  ^0.4.24;

contract CeoAndEmpl {
    struct ConsId {
        string c_id;
        string p_id;
        string work_place_name;
        string b_name;
        string p_name;
        string p_phone;
        string p_address;
    }
    
    struct ConsTime {
        string start_period;
        string end_period;
        string c_date;
        string start_work_time;
        string end_work_time;
        string payday;
        string hour_wage;
    }

    struct ConsCont{
        string dedicated_work;
        string work_place;
        string work_detail;
        string additional_wage;
        string b_number;
        string c_address;
        string work_place_phone;
       
    }
    mapping(uint => ConsId) consIdent;
    mapping(uint => ConsTime) consTimeIdent;
    mapping(uint => ConsCont) consContIdent;

    function addConsId(uint c_code, string _c_id,
        string _p_id,
        string _work_place_name,
        string _b_name,
        string _p_name,
        string _p_phone,
        string _p_address) public {
                	         
        consIdent[c_code] = ConsId (_c_id,_p_id,_work_place_name, _b_name,_p_name,_p_phone,_p_address);
    }

    function getConsId(uint c_code) view returns (string,string,string,string,string,string,string) {
        ConsId memory ci = consIdent[c_code];
        return (
                ci.c_id,
                ci.p_id,
                ci.work_place_name,
                ci.b_name,
                ci.p_name,
                ci.p_phone,
                ci.p_address
                );
    }
    
    function addConsTime(uint c_code, string _start_period,string _end_period,
                     string _c_date,string _start_work_time,string _end_work_time,string _payday, string _hour_wage) public {
                	         
        consTimeIdent[c_code] = ConsTime(_start_period,_end_period,_c_date,_start_work_time,_end_work_time,_payday, _hour_wage);
    }

    function getConsTime(uint c_code) view returns (string,string,string,string,string,string,string) {
        ConsTime memory ct = consTimeIdent[c_code];
        return (
                ct.hour_wage,
                ct.start_period,
                ct.end_period,
                ct.c_date,
                ct.start_work_time,
                ct.end_work_time,
                ct.payday
                );
    }
    
    
    function addConsCont(uint c_code,
        string _dedicated_work,
        string _work_place,
        string _work_detail,
        string _additional_wage,
        string _b_number,
        string _c_address,
        string _work_place_phone) public {
                	         
        consContIdent[c_code] = ConsCont(_dedicated_work,_work_place,_work_detail
                                    ,_additional_wage,_b_number,_c_address,_work_place_phone);
    }

    function getConsCont(uint c_code) view returns (string,string,string,string,string,string,string) {
        ConsCont memory cc = consContIdent[c_code];
        return (
                cc.dedicated_work,
                cc.work_place,
                cc.work_detail,
                cc.additional_wage,
                cc.b_number,
                cc.c_address,
                cc.work_place_phone
                );
    }

}
